import React, { Component } from 'react'

class Skills extends Component {
    constructor(props)
    {
        super(props);
        this.state={
            'myskills':['HTML','CSS','REACT JS','GIT', 'WORDPRESS', 'PHOTOSHOP']
        };
    }

    render() {
        return (
            <div className="col-home">
            <h1 className="subtopic">My Skills</h1>
            <p className="about">
            {this.state.myskills.map((value)=>{
                return <p><center>{value}</center></p>
            })}
            </p>
            <h1 className="subtopic">My Projects</h1>
            <p className="about">My Alternative Portfolio (WordPress)</p>
            <p className="about">React Stock Market App (Utilizing API)</p>
            <p className="about">React Book Recommendation App</p>
            <p className="about">Things to Do Website (WordPress)</p>
            <p className="about">React Coding Challenges</p>
            </div>
            )
        }
    }

    export default Skills


